    <ul>
        <li><h2>{{ category.name }}</h2>
            {% for article in category.articles %}
            <ul>
                <li><h3>{{ article.title }}</h3>
                    <p>{{ article.content }}</p>
                </li>
            </ul>
            {% endfor %}
        </li>

    </ul>
    {% endfor %}
</div>
{% endblock %}
